# Try to extract the table of contents or section headers for ViT/vision transformer
with open(pdf_path, 'rb') as f:
    reader = PyPDF2.PdfReader(f)
    toc = []
    for i, page in enumerate(reader.pages):
        text = page.extract_text()
        if text:
            lines = text.split('\n')
            for line in lines:
                if 'vision transformer' in line.lower() or 'ViT' in line or 'Vision Transformer' in line:
                    toc.append((i, line))
print(toc)
